### Summary of Core Topics, Concepts, Principles, and Equations

#### JavaScript Fundamentals
1. **Variable Declarations**:
   - `var`, `let`, and `const`
   - Scoping rules: `var` is function-scoped, `let` and `const` are block-scoped.
   - Hoisting: `var` is hoisted and initialized with `undefined`, `let` and `const` are hoisted but not initialized.

2. **Immediately Invoked Function Expressions (IIFE)**:
   - Syntax: `(function() { /* code */ })();`
   - Arrow function IIFE: `( () => { /* code */ } )();`

3. **Arrow Functions**:
   - Syntax: `(params) => { /* code */ }`
   - Concise body: `(params) => expression`

4. **Event Loop**:
   - Call stack, callback queue, and event loop mechanism.
   - Non-blocking I/O operations.

5. **Object Methods and `this`**:
   - `apply`, `call`, and `bind` methods.
   - Context binding and `this` keyword.

6. **Destructuring**:
   - Array destructuring: `const [a, b, ...rest] = array;`
   - Object destructuring: `const { prop1, prop2 } = object;`

7. **Classes and Objects**:
   - Class syntax: `class MyClass { constructor() { /* code */ } }`
   - Instance properties and methods.

#### Vue.js Fundamentals
1. **Vue Instance**:
   - Lifecycle hooks: `beforeCreate`, `created`, `beforeMount`, `mounted`.
   - Data properties and methods.

2. **Components**:
   - Component registration: `Vue.component('my-component', { /* options */ })`
   - Props and slots.

3. **Templates and Directives**:
   - Template syntax: `{{ message }}`
   - Directives: `v-if`, `v-for`, `v-on`, `v-bind`.

